function ServiceCard({ icon, title, description, color = 'bg-blue-100', iconColor = 'text-blue-600' }) {
  return (
    <div className="service-card text-center">
      <div className={`mb-4 inline-block p-4 rounded-full ${color}`}>
        {icon ? (
          <span className={`w-8 h-8 ${iconColor}`}>{icon}</span>
        ) : null}
      </div>
      <h3 className="font-semibold text-xl mb-2">{title}</h3>
      <p>{description}</p>
    </div>
  );
}

export default ServiceCard;
